### YamlMime:QSharpType
uid: microsoft.quantum.logical.notequall
name: NotEqualL
type: function
namespace: microsoft.quantum.logical
summary: Возвращает значение true только в том случае, если два входных значения не равны.
remarks: >-
  Следующие эквивалентны:


  ```Q#

  let cond = a != b;

  let cond = NotEqualL(a, b);

  ```
syntax: 'function NotEqualL (a : BigInt, b : BigInt) : Bool'
input:
  content: '(a : BigInt, b : BigInt)'
  types:
  - name: a
    summary: Первое сравниваемое значение.
    isPrimitive: true
    uid: BigInt
  - name: b
    summary: Второе сравниваемое значение.
    isPrimitive: true
    uid: BigInt
output:
  content: Bool
  types:
  - summary: '`true` Если и, только если `a` не равно `b` .'
    isPrimitive: true
    uid: Bool
